import ExpenseApp02 from './ExpenseApp02';
import ExpenseApp03 from './ExpenseApp03';
import ExpenseApp04 from './ExpenseApp04';
import ExpenseApp05 from './ExpenseApp05';
import ExpenseApp06 from './ExpenseApp06';
import ExpenseApp07 from './ExpenseApp07';
import ExpenseApp08 from './ExpenseApp08';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <ExpenseApp01 />
    <ExpenseApp02 />
    <ExpenseApp03 />
    <ExpenseApp04 />
    <ExpenseApp05 />
    <ExpenseApp06 />
    <ExpenseApp07 />
  </React.StrictMode>
);
